import React from "react"
import KupovinaKarteForm from "./KupovinaKarteForm"

class KupovinaKarte extends React.Component{
    constructor(){
        super()
        this.state = {
            sedista:[],
            projekcija:""
        }
    }

    componentDidMount(){
        const conf={
            headers: new Headers({'Authorization': 'Bearer ' + localStorage.getItem('jwt')},
                                  {'Access-Control-Allow-Methods':'GET'}),
          };

        fetch('http://localhost:8080/bioskop/sedista/'+this.props.state.projekcija.id,conf)
            .then(res => res.json())
            .then(response => this.setState({sedista:response}))

        this.setState({projekcija:this.props.state.projekcija})
    }

    render(){
        return(
            <div id="kupovinaKarte">
                <KupovinaKarteForm state={this.state}/>
            </div>
        )
    }
}

export default KupovinaKarte
